import React, { useState, useEffect } from "react"
import {csv} from "d3"
import data_json from "./Components/states.json"
//import us_states from "./Components/states_obs.csv"
import "./App.css"
import Navbar from "./Components/Navbar"
import Section from "./Components/Section"
import dummyText from "./DummyText"
import ReactFlexyTable from 'react-flexy-table'
import 'react-flexy-table/dist/index.css'
import GeoChart from "./Components/GeoChart"


function App() {
  const [data, setData] = useState();

  useEffect(() => {
  csv(data_json).then(setData);
}, []);

  console.log("datae: ", data_json)



// returns App Components
    return (
      <div className="App">
        <Navbar />
        <Section
          title="Financial Literacy in The U.S."
          subtitle={"Click on the state to see financial literacy grade"}
          dark={false}
          id="section1"
        />
        <Section
          title="Section 2"
          subtitle={"Kathia Vargas Feliz"}
          content={<ReactFlexyTable data={data}/>}
          subcontent={
            <div>
            <h2>World Map with d3-geo</h2>
            <h2>Select property to highlight</h2>
            <select
              value={data}
              onChange={event => setData(event.target.value)}>
            <option value="CENSUSAREA">Census Area</option>
            <option value="STATE">State ID</option>
            </select>
           </div>}
          dark={false}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={true}
          id="section5"
        />
      </div>
    );
}

export default App;
